#0005 tbd
 IRIS_super_evnet_title_0005:0 "爱丽诺大革命"
 IRIS_super_evnet_desc_0005:0 "我不惧怕，我生来就是为完成这任务。"
 IRIS_super_evnet_quote_0005:0 "- - - 贞德·达尔克 - - -"
 IRIS_super_evnet_btn_0005:0 "鸢尾花正在燃烧"
#0006 tbd
 IRIS_super_evnet_title_0006:0 "一月风暴"
 IRIS_super_evnet_desc_0006:0 "直到用最后一个资本家的肠子勒死最后一个官僚之前，人都是不自由的。"
 IRIS_super_evnet_quote_0006:0 "- - - 一月风暴街头标语 - - -"
 IRIS_super_evnet_btn_0006:0 "革命，只是一个开始。"
#0007 tbd
 IRIS_super_evnet_title_0007:0 "卡美洛内战"
 IRIS_super_evnet_desc_0007:0 "汲取了万人的意愿而却只回应其一的奇迹，\n从一开始就不应该存在"
 IRIS_super_evnet_quote_0007:0 "- - - 阿尔托莉雅·潘德拉贡 - - -"
 IRIS_super_evnet_btn_0007:0 "风暴降临昂格利亚"
#0008 tbd
 IRIS_super_evnet_title_0008:0 "欧罗巴战火再燃"
 IRIS_super_evnet_desc_0008:0 "凡事必须要有统一和决断，因此，胜利不站在智慧的一方，而站在自信的一方。"
 IRIS_super_evnet_quote_0008:0 "- - - 波利娜·波拿巴 - - -"
 IRIS_super_evnet_btn_0008:0 "战争即地狱"
#0009 tbd
 IRIS_super_evnet_title_0009:0 "欧罗巴统一"
 IRIS_super_evnet_desc_0009:0 "欧洲不会一下子就建成，也不会根据一个既定的单一计划建成。欧洲将通过实打实的成就建成，而这些成就将首先创造出实际上的团结一心。"
 IRIS_super_evnet_quote_0009:0 "- - - 《帕莉丝宣言》 - - -"
 IRIS_super_evnet_btn_0009:0 "欧罗巴的明天从未如此光明"
#0010 tbd
 IRIS_super_evnet_title_0010:0 "血月再临"
 IRIS_super_evnet_desc_0010:0 "她自另一维度翩翩而至，血雨由她而来，腥风因她而起"
 IRIS_super_evnet_quote_0010:0 "为这凡尘俗世带来无尽的纷扰与变革。"
 IRIS_super_evnet_btn_0010:0 "波澜再起"
#0011 tbd
 IRIS_super_evnet_title_0011:0 "奥西娅联邦内战"
 IRIS_super_evnet_desc_0011:0 "世界上没有幸福这回事儿，唯一的在于你死了很久以后的遥远的将来。"
 IRIS_super_evnet_quote_0011:0 "而从你向党宣战开始，最好把自己当作一具尸体。"
 IRIS_super_evnet_btn_0011:0 "冲动的价值、无产者、人性"
#0012 tbd
 IRIS_super_evnet_title_0012:0 "恶魔降临IRIS"
 IRIS_super_evnet_desc_0012:0 "“我轻蔑侵蚀了那等同于神明的神圣之物，能办到这种事的，就只能称之为【恶魔】了吧”"
 IRIS_super_evnet_quote_0012:0 "“你们人类的感情真是太危险了”"
 IRIS_super_evnet_btn_0012:0 "恶魔也不能使我们屈服"
#0013 tbd
 IRIS_super_evnet_title_0013:0 "罗西亚革命"
 IRIS_super_evnet_desc_0013:0 "大海不会干涸,人民不会迷路。"
 IRIS_super_evnet_quote_0013:0 "熊熊烈火于朽木之上煌煌燃起。"
 IRIS_super_evnet_btn_0013:0 "前进！"
#0014 tbd
 IRIS_super_evnet_title_0014:0 "赛莲斯护国战争"
 IRIS_super_evnet_desc_0014:0 "北伐烈士岂非枉死二十年哉?"
 IRIS_super_evnet_quote_0014:0 "于九泉下效先总理，历万世后报新公民!"
 IRIS_super_evnet_btn_0014:0 "护祖国，捍共和!"
#0015 tbd
 IRIS_super_evnet_title_0015:0 "大海战"
 IRIS_super_evnet_desc_0015:0 "人类的思考，太过拘泥于个体。也就是所谓的幼稚。而我们毫无个体概念，我们是“海雾舰队”，一切都是被决定好的。即使你被击沉了，“海雾”依然是“海雾”。"
 IRIS_super_evnet_quote_0015:0 "——雾之舰队"
 IRIS_super_evnet_btn_0015:0 "拥有意志也许是一件很残酷的事情"
#0016 tbd
 IRIS_super_evnet_title_0016:0 "二次北伐"
 IRIS_super_evnet_desc_0016:0 "仍萦绕土地的英魂，为苦痛折磨的生灵"
 IRIS_super_evnet_quote_0016:0 "他们都将在此前进，直抵达理想与明天"
 IRIS_super_evnet_btn_0016:0 "革命永不亡!"
#0017 tbd
 IRIS_super_evnet_title_0017:0 "凉宫春日的重现"
 IRIS_super_evnet_desc_0017:0 "测试用词"
 IRIS_super_evnet_quote_0017:0 "测试用词"
 IRIS_super_evnet_btn_0017:0 "测试用词"
