#0019 tbd
 IRIS_super_evnet_title_0019:0 "昂格利亚战争"
 IRIS_super_evnet_desc_0019:0 "昂格利亚人对于战争和爱情从来都是不择手段的"
 IRIS_super_evnet_quote_0019:0 "- - - 大吉岭 - - -"
 IRIS_super_evnet_btn_0019:0 "战争，再一次"
#0020 tbd
 IRIS_super_evnet_title_0020:0 "昂格利亚和解"
 IRIS_super_evnet_desc_0020:0 "已然走向和平的我们，不能再葬送任何人的未来"
 IRIS_super_evnet_quote_0020:0 "- - - 薇尔莉特•伊芙加登 - - -"
 IRIS_super_evnet_btn_0020:0 "于是，家门敞开了"
#0021 tbd
 IRIS_super_evnet_title_0021:0 "学园都市建立"
 IRIS_super_evnet_desc_0021:0 "我会让联邦学生会走上应有的正轨 我会让基沃托斯更加的稳定而安全 我会去找回被你们藏匿起来的会长"
 IRIS_super_evnet_quote_0021:0 "- - - 不知火 花耶 - - -"
 IRIS_super_evnet_btn_0021:0 "而你，只需要注视这一切就好了。"
