 IRIS_super_evnet_title_0023:0 "学园都市建立"
 IRIS_super_evnet_desc_0023:0 "不过放心好了，我会解决这一切的\n就像那个人曾经做到的一样……"
 IRIS_super_evnet_quote_0023:0 "- - - 不知火 花耶 - - -"
 IRIS_super_evnet_btn_0023:0 "我很清醒，非常清醒"
