#0025 tbd
 IRIS_super_evnet_title_0025:0 "由西住流绘制的乌斯拉尔"
 IRIS_super_evnet_desc_0025:0 "一击必中、固若金汤、临危不乱、铁之准则、钢之意志。"
 IRIS_super_evnet_quote_0025:0 "- - - 西住真穗 - - -"
 IRIS_super_evnet_btn_0025:0 "这就是西住流。"
#0026 tbd
 IRIS_super_evnet_title_0026:0 "赤红彼岸花"
 IRIS_super_evnet_desc_0026:0 "今天，就让我们来庆祝你这名新同志的诞生吧。"
 IRIS_super_evnet_quote_0026:0 "- - - 安守 实里 - - -"
 IRIS_super_evnet_btn_0026:0 "革命永不灭"
#0027 tbd
 IRIS_super_evnet_title_0027:0 "蔷薇革命"
 IRIS_super_evnet_desc_0027:0 "没有无产阶级对旧有的资产阶级的国家机器的彻底破坏，就没有走向社会主义的可能与未来。"
 IRIS_super_evnet_quote_0027:0 "- - - 威尔玛·毕晓普 - - -"
 IRIS_super_evnet_btn_0027:0 "五月的风儿轻轻吹"
#0028 乌斯拉尔临时军政府与内战
 IRIS_super_evnet_title_0028:0 "乌斯拉尔内战"
 IRIS_super_evnet_desc_0028:0 "万岁！英雄的民族，万岁！不朽的祖国，你的儿女再展抱负，胸怀理想忠诚牢固。"
 IRIS_super_evnet_quote_0028:0 "我们的法律是爱的奴役，我们的座右铭是责任与自由。"
 IRIS_super_evnet_btn_0028:0 "帝制不是野心，而是历史的必然。"
#0029 乌斯拉尔内战结束 帝国旧秩序的恢复
 IRIS_super_evnet_title_0029:0 "旧秩序的胜利"
 IRIS_super_evnet_desc_0029:0 "帝冠之下，万民安宁；秩序非因强权，而因信念与责任而生。"
 IRIS_super_evnet_quote_0029:0 "- - - 瓦格纳·列考德尼 - - -"
 IRIS_super_evnet_btn_0029:0 "国王的头衔乃是光荣的苦役"
#0030 幕府胜利
 IRIS_super_evnet_title_0030:0 "武家凯旋"
 IRIS_super_evnet_desc_0030:0 "水若不流花不落，两心永隔暗冥中。"
 IRIS_super_evnet_quote_0030:0 "- - - 冲田 总司 - - -"
 IRIS_super_evnet_btn_0030:0 "青天之下，诚字旗将永远飘扬"
#0031 邦邦胜利
 IRIS_super_evnet_title_0031:0 "崭新的早樱"
 IRIS_super_evnet_desc_0031:0 "向着世上那最闪耀之处，一起一往无前吧PEOPLE！来与我一起！"
 IRIS_super_evnet_quote_0031:0 "- - - Poppin'Party - - -"
 IRIS_super_evnet_btn_0031:0 "名为“自由”的新时代"
#0032 涤圣海大海战
 IRIS_super_evnet_title_0032:0 "涤圣海大海战"
 IRIS_super_evnet_desc_0032:0 "风起云涌，千帆争渡。悠悠长歌，浩浩征途。"
 IRIS_super_evnet_quote_0032:0 "- - - 船歌- - - "
 IRIS_super_evnet_btn_0032:0 "大海在燃烧"
#0033 合众国内战
 IRIS_super_evnet_title_0033:0 "合众国内战"
 IRIS_super_evnet_desc_0033:0 "“自由”与“合众”，实际上都和这个国家无关。"
 IRIS_super_evnet_quote_0033:0 "- - - 《不睦之家》- - - "
 IRIS_super_evnet_btn_0033:0 "团结不再"
